#include <iostream>
#include <vector>
#include <stack>
#include <algorithm>
#include <limits>
#include <queue>
#include <map>

using namespace std;

class Solution {
    public:
        void solve(vector<vector<char> > &board) {
            int n=board.size();
            if (n == 0)
                return;
            int m = board[0].size();

            if (m == 0)
                return;

            for (int i=0; i<n; i++) {
                if (board[i][0]=='O')
                    expand_boundary(board, i, 0);
                if (board[i][m-1]=='O')
                    expand_boundary(board, i, m-1);
            }
            for (int j = 1; j < m-1; j++) {
                if (board[0][j]=='O')
                    expand_boundary(board, 0, j);
                if (board[n-1][j]=='O')
                    expand_boundary(board, n-1, j);
            }
            for (int i=0; i<n; i++)
                for (int j=0; j<m; j++) {
                    if (board[i][j]=='O')   // set all remaining 'O' to 'X'
                        board[i][j] = 'X';
                    if (board[i][j]=='*')   // restore all '*' to 'O'
                        board[i][j] = 'O';
                }
            return;
        }

   private:
        void expand_boundary(vector<vector<char> > &board, int x, int y)
        {   
            // expand board[x][y] to all connected 'o', change to '*'
            if (board[x][y]!='O')   return;
            stack<pair<int,int> > S;
            S.push(make_pair(x,y));
            while (!S.empty()) {
                pair<int,int> p = S.top();
                S.pop();
                board[p.first][p.second] = '*';
                if (valid(board,p.first+1,p.second) && board[p.first+1][p.second]=='O')
                    S.push(make_pair(p.first+1,p.second));
                if (valid(board,p.first-1,p.second) && board[p.first-1][p.second]=='O')
                    S.push(make_pair(p.first-1,p.second));
                if (valid(board,p.first,p.second+1) && board[p.first][p.second+1]=='O')
                    S.push(make_pair(p.first,p.second+1));
                if (valid(board,p.first,p.second-1) && board[p.first][p.second-1]=='O')
                    S.push(make_pair(p.first,p.second-1));
            }
            return;
        }
        bool valid(vector<vector<char> > &board, int i, int j)
        {
            if (i<0 || i>=board.size())    return false;
            if (j<0 || j>=board[0].size())    return false;
            return true;
        }
};
int main() {
    vector<vector<char> > b(5, vector<char>(5, 'X'));

    b[1][1] = 'O';
    b[1][2] = 'O';
    b[1][3] = 'O';
    b[2][2] = 'O';
    b[2][3] = 'O';
    b[3][3] = 'O';
    b[4][1] = 'O';

    Solution S;
    S.solve(b);
    for (int i = 0; i < b.size(); i ++){
        for (int j = 0; j <b[i].size(); j++)
            cout <<b[i][j];
        cout <<endl;
    }

    return 0;
}
